import React from 'react';

const CompForm1 = () => {
  return (
    <form>
      <fieldset>
        <legend>
          자바스크립트 문법 활용하기
        </legend>
        <p>
          <input type="radio" />라디오1
          <input type="radio" />라디오2
        </p>
      </fieldset>
    </form>
  );
};

export default CompForm1;
